import Note from "./Note"

const notes = ({notes}) => {
  let columnId = 0

    return (
      <>
      <h1>test</h1>
        {notes.map((note) => (
          <Note note={note} columnId={columnId+=1}/>
        ))}
      </>
    )
}

export default notes
